import "./Card.css";





		function Card(props , handleChoice){

	function handleClick(){
	handleChoice(props);
}

	return (
		<div className="card" >
        <div>
          <img className="front" src={props.src} alt = "card-Front"/>
          <img className="back" 
          src ="/images/blank.png" 
          onClick = {handleClick}
          alt = "card-Back"/>
        </div>
        </div>
		);
}

export {Card};
